import { DN600, N0, N700, N900 } from '@atlaskit/theme/colors';
var textColor = {
  light: N900,
  dark: DN600
};
var wrapperBackgroundColor = {
  light: N0,
  dark: N700
};
export var announcerStyle = {
  border: 0,
  clip: 'rect(0 0 0 0)',
  height: 1,
  margin: -1,
  overflow: 'hidden',
  padding: 0,
  position: 'absolute',
  width: 1
};
export var wrapperStyle = function wrapperStyle(mode) {
  return {
    backgroundColor: wrapperBackgroundColor[mode],
    color: textColor[mode],
    display: 'inline-block',
    padding: 16,
    userSelect: 'none',
    boxSizing: 'border-box',
    outline: 'none'
  };
};
